import React from "react";
import { NavLink } from "react-router-dom";
import {
  AppBar,
  Toolbar,
  Typography,
  Button,
  Container,
} from "@material-ui/core";

export default function Nav() {
  return (
    <nav>
      <AppBar>
        <Toolbar>
          <Container>
            <NavLink to="/" exact>
              Home
            </NavLink>
            <NavLink to="/add" exact>
              New Question
            </NavLink>
            <NavLink to="/leaderboard" exact>
              Leaderboard
            </NavLink>
            <Button variant="text">Log Out</Button>
          </Container>
        </Toolbar>
      </AppBar>
    </nav>
  );
}
